import styled from "styled-components";

export const Main = styled.main`
    width: 100vw;
    height: 100vh;
    display: flex;
    align-items: center;
    justify-content: center;
`
export const Section = styled.section`
    height: 50%;
    width: 50%;
    border: 0.1rem solid black;

`
